import React from 'react';
import styled from 'styled-components';

const Image = styled('img')`
    width: 32%;
`;


const Tile = ({data}) => {
    return (
        data.map(i => 
            <>
            <div>{i.list_price.amount || i.list_price_range.from.amount + ' - ' + i.list_price_range.to.amount }</div>
            <Image src={i.default_image_urls.main_image_url}/>
            </>
        )
    )
}

export default Tile;
